import csvimport mathimport randomimport numpy as npimport pandas as pdattributes=[ ]d=[]with open('test.txt',"r") as file:    line0 = file.readline()    attributes = line0.strip("(").strip(")\n").split(",")    for i in range(len(attributes)):        attributes[i] = attributes[i].strip(" ")    #print attributes    #attributes[i] = attributes[i].strip()    for index, lines in enumerate(file):        if index < 1: #skip first line            continue        else:             d.append(lines[3:].strip().strip(";\n").split(","))    for i in range(len(d)):        for j in range(7):            d[i][j] = d[i][j].strip(" ")    #print d[0]    df= np.array(d)    df_new = pd.DataFrame.from_records(df, columns=attributes)    df_ne=df_new.drop(columns="Enjoy")